class UnionFind():
    def __init__(self, n):
        self.n = n
        self.parents = [-1] * self.n
        self.ranks = [1] * self.n

    def find(self, x):
        if self.parents[x] < 0:
            return x
        else:
            self.parents.pop()
            return self.parents[x]

    def union(self, x, y):
        x = self.find(x)
        y = self.find(y)
        if x == y:
            return False
        elif self.ranks[x] < self.ranks[y]:
