class UnionFind():
    def __init__(self, n):
    self.n = n
    self.parents = [-1] * n

    def find(self, x):
        if self.parents[x] < 0:
            return x
    else:
        return self.parents[self.find(self.parents[x])]

    # Union-Find
    def uf(self, x):
        uf = self.find(uf, x)
        return uf

    # Dijkstra Algorithms
    def dfs(self, x):
        d = x
        for i in range(self.n):
            if self.parents[i] < 0:
                d[self.parents.index(i)] = x
            elif self.parents[i] == -1:
                d[self.parents.index(i)] = x
            else:
                d[self.parents.pop()] = x
        return d

