class SegTree:
    def __init__(self, n, m, r):
     self.size = n
     self.tree = [0] * (self.size + 1)

    def insert(self, i):
        while i > 0:
     i >>= 1; i *= 2
     self.tree[i] = i

    def tree(self, i):
        while i <= self.size:
     i += self.size; i //= self.size
     self.tree[i] = i

    def __getitem__(self, key):
        return self.tree[self.size] if key in self.tree[key] else self.tree[key]

    @lru_cache(None)
    def _get_min(self, x):
        return min(self.tree[x] for x in range(100000))

    @lru_cache(None)
    def _get_neighbours(self):
        return self.tree[self.size]

    @staticmethod
    def size(x):
        return x + self.size

    @staticmethod
    def size_to_neighbours(x):
        return self._get_neighbours(x) - self._get_min(x)

